    BrowserModule,
    AppRoutingModule,
    ProductModule,
    AuthenticationModule,
    ReactiveFormsModule,
    HeaderFooterModule,
    ProductModule,
    AdminModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
